import React from "react";

const ShowApis = ({ apis }) => {
  return (
    <>
      <div className="mt-5">
        <div className="container">
          <table class="table">
            <thead>
              <tr>
                <th scope="col">No</th>
                <th scope="col">Category</th>
                <th scope="col">Name</th>
                <th scope="col">Image</th>
                <th scope="col">Description</th>
              </tr>
            </thead>
            <tbody>
            {
                apis.map(()=>{
                    return(
                        <h1></h1>
                    )
                })
            }
              <tr>
                <th scope="row">1</th>
                <td>Mark</td>
                <td>Otto</td>
                <td>@mdo</td>
                <td>@mdo</td>
              </tr>
            </tbody>
          </table>
        </div>
      </div>
    </>
  );
};

export default ShowApis;
